function $(el) {
  return document.querySelector(el);
}

function $$(el) {
  return document.querySelectorAll(el);
}

function debounce(fn, delay = 1000, immediate = true) {
  let timer = null;
  return function (event) {
    if (timer) clearTimeout(timer);
    if (immediate) {
      const canExe = !timer;
      timer = setTimeout(() => {
        timer = null;
      }, delay);
      if (canExe) {
        fn(event);
      } else {
        console.log("您的操作太频繁了", "warning");
      }
    } else {
      timer = setTimeout(() => {
        fn(event);
        timer = null;
      }, delay);
    }
  };
}

function throttle(fn, delay = 1000, immediate = true) {
  if (immediate) {
    let previous = 0;
    return function (event) {
      const now = Date.now();
      if (now - previous > delay) {
        fn(event);
        previous = now;
      }
    };
  } else {
    let timer = null;
    return function (event) {
      if (!timer) {
        timer = setTimeout(() => {
          fn(event);
          timer = null;
        }, delay);
      }
    };
  }
}
